import React, { Component } from "react";
import "../App.css";
import ReactPlayer from "react-player";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import CardMedia from "@material-ui/core/CardMedia";
import IconButton from "@material-ui/core/IconButton";
import Typography from "@material-ui/core/Typography";
import SkipPreviousIcon from "@material-ui/icons/SkipPrevious";
import PlayArrowIcon from "@material-ui/icons/PlayArrow";
import SkipNextIcon from "@material-ui/icons/SkipNext";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
  },
  details: {
    display: "flex",
    flexDirection: "column",
  },
  content: {
    flex: "1 0 auto",
  },
  cover: {
    width: 151,
  },
  controls: {
    display: "flex",
    alignItems: "center",
    paddingLeft: theme.spacing(1),
    paddingBottom: theme.spacing(1),
  },
  playIcon: {
    height: 38,
    width: 38,
  },
}));

export default function Videos() {
  const classes = useStyles();
  const theme = useTheme();
  return (
    <body>
      <Card className={classes.root}>
        <Card className={classes.root}>
          <div className={classes.details}>
            <CardContent className={classes.content}>
              <Typography component="h5" variant="h5">
                Live From Space
              </Typography>
              <Typography variant="subtitle1" color="textSecondary">
                Mac Miller
              </Typography>
            </CardContent>
            <div className={classes.controls}>
              <IconButton aria-label="previous">
                {theme.direction === "rtl" ? (
                  <SkipNextIcon />
                ) : (
                  <SkipPreviousIcon />
                )}
              </IconButton>
              <IconButton aria-label="play/pause">
                <PlayArrowIcon className={classes.playIcon} />
              </IconButton>
              <IconButton aria-label="next">
                {theme.direction === "rtl" ? (
                  <SkipPreviousIcon />
                ) : (
                  <SkipNextIcon />
                )}
              </IconButton>
            </div>
          </div>
          <CardMedia
            className={classes.cover}
            image="/static/images/cards/live-from-space.jpg"
            title="Live from space album cover"
          />
        </Card>
      </Card>
      <div className="center">
        <List>
          <ListItem>
            <ReactPlayer
              url="https://www.youtube.com/watch?v=bS2ECh9Sees&list=LLbucXVn_RwkN7vgdWv_Pukw&index=2&t=0s"
              playing
            />
          </ListItem>
          <ListItem>
            <ReactPlayer
              url="https://www.youtube.com/watch?v=LdHprvhehrQ&list=LLbucXVn_RwkN7vgdWv_Pukw&index=3&t=0s"
              playing
            />
          </ListItem>
          <ListItem>
            <ReactPlayer
              url="https://www.youtube.com/watch?v=uRilip0v9e8&list=LLbucXVn_RwkN7vgdWv_Pukw&index=21&t=0s"
              playing
            />
          </ListItem>
          <ListItem>
            <ReactPlayer
              url="https://www.youtube.com/watch?v=9m4v1PPPv90&list=LLbucXVn_RwkN7vgdWv_Pukw&index=22&t=0s"
              playing
            />
          </ListItem>
        </List>
      </div>
    </body>
  );
}
